  const root = ReactDOM.createRoot(document.getElementById("root"));
  root.render(
    <React.StrictMode>
        <App/>
    </React.StrictMode>
  );

store.subscribe(()=> {
  const root = ReactDOM.createRoot(document.getElementById("root"));
  root.render(
    <React.StrictMode>
        <App/>
    </React.StrictMode>
  );
})
